PROBLEM: 'Alicia had two containers. The first was '$\tfrac{5}{6}$' full of water and the second was empty. She poured all the water from the first container into the second container, at which point the second container was '$\tfrac{3}{4}$' full of water. What is the ratio of the volume of the first container to the volume of the second container?\n'
=======
CHOICES:
[A]: \frac{5}{8}
[B]: \frac{4}{5}
[C]: \frac{7}{8}
[D]: \frac{9}{10}
[E]: \frac{11}{12}

PROBLEM: 'Right triangles '$T_1$' and '$T_2$', have areas of 1 and 2, respectively. A side of '$T_1$' is congruent to a side of '$T_2$', and a different side of '$T_1$' is congruent to a different side of '$T_2$'. What is the square of the product of the lengths of the other (third) sides of '$T_1$' and '$T_2$'?\n'
=======
CHOICES:
[A]: \frac{28}{3}
[B]: 10
[C]: \frac{32}{3}
[D]: \frac{34}{3}
[E]: 12

PROBLEM: 'Henry decides one morning to do a workout, and he walks '$\tfrac{3}{4}$' of the way from his home to his gym. The gym is '$2$" kilometers away from Henry's home. At that point, he changes his mind and walks "$\tfrac{3}{4}$' of the way from where he is back toward home. When he reaches that point, he changes his mind again and walks '$\tfrac{3}{4}$' of the distance from there back toward the gym. If Henry keeps changing his mind when he has walked '$\tfrac{3}{4}$' of the distance toward either the gym or home from the point where he last changed his mind, he will get very close to walking back and forth between a point '$A$' kilometers from home and a point '$B$' kilometers from home. What is '$|A-B|$'?\n'
=======
CHOICES:
[A]: \frac{2}{3}
[B]: 1
[C]: 1 \frac{1}{5}
[D]: 1 \frac{1}{4}
[E]: 1 \frac{1}{2}

PROBLEM: 'Debra flips a fair coin repeatedly, keeping track of how many heads and how many tails she has seen in total, until she gets either two heads in a row or two tails in a row, at which point she stops flipping. What is the probability that she gets two heads in a row but she sees a second tail before she sees a second head?\n'
=======
CHOICES:
[A]: \frac{1}{36}
[B]: \frac{1}{24}
[C]: \frac{1}{18}
[D]: \frac{1}{12}
[E]: \frac{1}{6}

PROBLEM: 'Raashan, Sylvia, and Ted play the following game. Each starts with '$$1$'. A bell rings every '$15$' seconds, at which time each of the players who currently have money simultaneously chooses one of the other two players independently and at random and gives '$$1$' to that player. What is the probability that after the bell has rung '$2019$' times, each player will have '$$1$'? (For example, Raashan and Ted may each decide to give '$$1$' to Sylvia, and Sylvia may decide to give her dollar to Ted, at which point Raashan will have '$$0$', Sylvia will have '$$2$', and Ted will have '$$1$', and that is the end of the first round of play. In the second round Rashaan has no money to give, but Sylvia and Ted might choose each other to give their '$$1$' to, and the holdings will be the same at the end of the second round.)\n'
=======
CHOICES:
[A]: \frac{1}{7}
[B]: \frac{1}{4}
[C]: \frac{1}{3}
[D]: \frac{1}{2}
[E]: \frac{2}{3}

PROBLEM: 'Points '$A=(6,13)$' and '$B=(12,11)$' lie on circle '$\omega$' in the plane. Suppose that the tangent lines to '$\omega$' at '$A$' and '$B$' intersect at a point on the '$x$'-axis. What is the area of '$\omega$'?\n'
=======
CHOICES:
[A]: \frac{83\pi}{8}
[B]: \frac{21\pi}{2}
[C]: \frac{85\pi}{8}
[D]: \frac{43\pi}{4}
[E]: \frac{87\pi}{8}
